import React from 'react';
const Footer = () => {
  return (<div style={{
      background: '#292a2b',
      textAlign: "center",
      fontSize: '20px',
      height: '80px', display: 'flex',
      flexDirection: 'column', alignItems: 'center',
      justifyContent: 'center', fontSize:'1rem'
  }}>
    <p className="text-white py-4 m-0">made by Shukaze</p>
    </div>)
}
export default Footer;
